import React from 'react'
import { useLocation } from 'react-router-dom'

export default function Detail() {

    const {state} = useLocation();

    const id = search.get('id');
    const title = search.get('title');
    const context = search.get('context');

    return (
        <div>
            <ul>
                <li>{id}</li>
                <li>{title}</li>
                <li>{context}</li>
            </ul>
        </div>
    )



}
